import { useEffect, useState } from "react";
import Navbar from "../../components/navbar/Navbar";
import classes from "./Transaction.module.css";

const Transaction = () => {
  const userId = JSON.parse(localStorage.getItem("token"));
  const [transaction, setTransaction] = useState([]);
  useEffect(() => {
    async function getTransaction() {
      const response = await fetch(
        `http://localhost:5000/transaction/${userId}`
      );
      const data = await response.json();
      console.log(data);
      setTransaction(data);
    }
    getTransaction();
  }, [transaction]);

  return (
    <>
      <Navbar />
      <div className={classes.tran}>
        <h1>Your Transaction</h1>
        <table>
          <tr>
            <th>#</th>
            <th>Hotel</th>
            <th>Room</th>
            <th>Date</th>
            <th>Price</th>
            <th>Pagement method</th>
            <th>status</th>
          </tr>
          {transaction.map((tran, index) => {
            <tr>
              <td>{`0${index + 1}`}</td>
              <td>HANOI ROYAL PALACE HOTEL 2</td>
              <td>{tran.room.map((i) => i.roomNumber)}</td>
              <td>20/03/2023-21/03/2023</td>
              <td>$1000</td>
              <td>Cash</td>
              <td>checkin</td>
            </tr>;
          })}
        </table>
      </div>
    </>
  );
};

export default Transaction;
